import { useEffect } from 'react';
import useAnimateScroll from '../../hooks/useAnimateScroll';
import Apresentacao from "../../componentes/sobreApresentacao/apresentacao";
import Video from "../../componentes/sobreVideo/video";
import Resumo from "../../componentes/sobreResumo/Resumo";
import Informacoes from "../../componentes/sobreInformacoes/informacoes";

export default function SobreMim() {
  useAnimateScroll(); // Ativa o sistema de animação

  return (
    <section>
      <div data-animate="fade-up" className="delay-100">
        <Apresentacao />
      </div>
      
      <div data-animate="fade-left" className="delay-200">
        <Video />
      </div>
      
      <div data-animate="fade-right" className="delay-300">
        <Resumo />
      </div>
      
      <div data-animate="fade-up" className="delay-400">
        <Informacoes />
      </div>
    </section>
  );
}
